/* eslint-disable no-trailing-spaces */
/* eslint-disable no-unused-vars */
import React from 'react'
import { motion } from 'framer-motion'

function Landing () {
  const variants = {
    visible: {
      x: 0,
      transition: {
        when: 'beforeChildren',
        // staggerChildren: 3,
        type: 'spring',
        damping: 15
      }
    },

    rotate: {
      rotate: 90
    }
  }
  return (
    <motion.div className='landingContainer'
      initial={{ x: -10000 }}
      variants={variants}
      animate='visible'
    >
      <motion.div className='landingTop'
        initial={{ x: -1000 }}
        variants={variants}
        animate='visible'
      >
      </motion.div>
      <motion.div className='landingBottom'
        initial={{ x: -1000 }}
        animate='visible'
      >
      </motion.div>
    </motion.div>
  )
}

export default Landing
